import React, {useState} from 'react';
import './Node.css';
export default function Node (props) {

    const {row, col, isFinish, isStart, isWall, isVisited, onMouseDown, onMouseUp, onMouseEnter} = props;
    const extraClassName = isFinish ? 'node-finish' : isStart ? 'node-start' : isWall ? 'node-is-wall' : isVisited ? '' : '';

    return(
        <div 
            id={`node-${row}-${col}`}
            className={`node ${extraClassName}`}
            onMouseUp={() => onMouseUp()}
            onMouseDown={() => onMouseDown(row, col)}
            onMouseEnter={() => onMouseEnter(row, col)}
        >
        </div>
    );
}
